import React from 'react';
import logo from '../public/logo.png';

function  Header() {
    return(
        <header>
  <nav>
    <img src={logo} alt='Logo' />
    <span>SuGa</span>
    <button className='Nav-link'>
        SignIn
    </button>
  </nav>
        </header>
    )
}
export default Header;
